import './App.css';
import logo from '../logo.svg';
import Header from './Header';
import Body from './Body';
const App = () => {
return(
   <div>
    <Header title="Frontend authenticated with Spring JWT" logoSrc={logo}> </Header>
    <Body/>
   </div>
)
}

export default App;
